        self.label_6.setText(_translate("MainWindow", "Alice & Bob"))
        self.label_7.setText(_translate("MainWindow", "<html><head/><body><p><span style=\" font-size:11pt; font-weight:600;\"><br/></span></p><p><span style=\" font-size:11pt; font-weight:600;\">Alice &amp; Bob must first share a secret password using RSA Asymmetric Encrption.</span></p><p><span style=\" font-size:11pt; font-weight:600;\">Then they can use the secret password to share SHA-256 messages, which can be any length. <br/></span></p></body></html>"))
        self.label_8.setText(_translate("MainWindow", "<html><head/><body><p>Alice Uses Bob\'s public key to RSA Encrypt the password and send it to Bob. </p><p>Bob uses his private key to RSA Decrypt the password. </p><p>Alice and Bob can then use the shared secret password to encrypt and decrypt longer messages. The encrypted messages can be sent or posted uisng any standard communication channel, and nothing is ever saved or sent by this program, so Alice and Bob don\'t have to trust anyone. No service providers. No installations. No PhD needed. </p><p>DISCLAIMER: Your data is only as secure as your password, and the fastest computers trying to crack it. Computers get faster at an exponential rate. We recommend you use a very VERY long password. The longer the password, the more secure your data. Legal: we make no warranties, express or implied and are not liable for damages. Use at your own risk. </p></body></html>"))
        self.label_9.setText(_translate("MainWindow", "<html><head/><body><p><span style=\" font-size:14pt;\">m360Encrypt allows you to use existing insecure channels for secure communication. </span></p></body></html>"))
        self.tabWidget.setTabText(self.tabWidget.indexOf(self.tab_5), _translate("MainWindow", "How It Works"))
        self.label_15.setText(_translate("MainWindow", "<html><head/><body><p><span style=\" font-size:14pt; font-weight:600;\">Load Key Pairs</span></p><p><span style=\" font-size:10pt;\">You can use an existing Key Pair or generate a new one.</span></p><p><span style=\" font-size:10pt;\">These keys are used to encrypt and decrypt the shared password. </span></p></body></html>"))
        self.label_17.setText(_translate("MainWindow", "<html><head/><body><p><span style=\" font-weight:600;\">Copy and paste your own </span><span style=\" font-weight:600; text-decoration: underline;\">private</span><span style=\" font-weight:600;\"> key here or click on the button to load it from a file</span></p></body></html>"))
        self.label_18.setText(_translate("MainWindow", "<html><head/><body><p><span style=\" font-weight:600;\">Copy and paste your partner\'s </span><span style=\" font-weight:600; text-decoration: underline;\">public</span><span style=\" font-weight:600;\"> key here or click on the button to load it from a file</span></p></body></html>"))
        self.pushButton.setText(_translate("MainWindow", "Select File"))
        self.pushButton_3.setText(_translate("MainWindow", "Select File"))
        self.pushButton_4.setText(_translate("MainWindow", "LOAD KEYS"))
        self.label_21.setToolTip(_translate("MainWindow", "<html><head/><body><p>-- Before you can exchange messages, you and your partner need to agree on a password. <br/>( If you have already agreed on a password, you can skip this step )</p><p>-- Key Pairs will help you exchange the password in an encrypted format, so no one else can read it. </p><p>-- If you don\'t already have key files, go to the &quot;other tools&quot; tab and generate new keys.</p><p>-- When you\'re finished, &quot;Load&quot; the keys. This program will use the loaded keys to encrypt or decrypt the shared password. </p></body></html>"))
        self.label_22.setToolTip(_translate("MainWindow", "<html><head/><body><p>You can either paste your private key in here, or you can load it from a file. This program will use your private key to decrypt a password that your partner has sent to you. </p></body></html>"))
        self.label_28.setToolTip(_translate("MainWindow", "<html><head/><body><p>You can either paste your partner\'s public key, or you can select it from a file. This key will be used to encrypt a password that only your partner can decrypt </p></body></html>"))
        self.tabWidget.setTabText(self.tabWidget.indexOf(self.tab_3), _translate("MainWindow", "Load Key Pairs"))
        self.label_3.setText(_translate("MainWindow", "<html><head/><body><p><span style=\" font-size:12pt; font-weight:600;\">RSA Encrypt</span></p><p><span style=\" font-size:12pt;\">Use RSA to encrypt a shared password. </span></p><p>Prerequisites to Encrypt: You must have your communication partner\'s public key. </p><p><br/><br/></p></body></html>"))
        self.label_10.setText(_translate("MainWindow", "What password do you want to share with your partner?"))
