        self.label_20.setToolTip(_translate("MainWindow", "<html><head/><body><p>-- Before you can exchange messages, you and your partner need to agree on a password. </p><p>-- This tab lets you choose a password and encrypt it. Only your partner can decrypt it. <br/><br/>1. Load the public key of the person you\'re sending the password to<br/>2. Type a long secure passphrase or password that\'s less than 128 characters long<br/>3. Press the Encrypt button<br/>4. Share the encrypted password with your partner any way you want (chat, email, etc)</p><p>When you\'re finished, &quot;Load&quot; the password. This program will use the loaded password to encrypt and decrypt messages. </p></body></html>"))
        self.tabWidget.setTabText(self.tabWidget.indexOf(self.tab), _translate("MainWindow", "RSA Encrypt"))
        self.label_4.setText(_translate("MainWindow", "<html><head/><body><p><span style=\" font-size:12pt; font-weight:600;\">RSA Decrypt</span></p><p><span style=\" font-size:12pt;\">Use RSA to decrypt a shared password. </span></p><p>Prerequisites to Decrypt: The password must be encrypted with your public key. </p><p><br/><br/></p></body></html>"))
